from parsing_hotels import load_train_test, prepare_task1
import re
import pymorphy2


# coding: utf-8
__author__ = 'air'

from gensim.models import Word2Vec
from os.path import exists

file_name_model = 'model_w2v.bin'


def splitter(text):
    exp = re.compile(r',|\.|!|:|\?|-| |\(|\)|<|>|"|&|\n|\t', re.IGNORECASE)
    return [word for word in re.split(exp, text) if len(word) > 1]


def load_gensim():
    if exists(file_name_model):
        w2v = Word2Vec.load(file_name_model)
    else:
        with open('out_from_tripad_1.txt') as f:
            sentences = f.read().split('.')
            sentences = [splitter(s) for s in sentences]
        w2v = Word2Vec(sentences=sentences)
        w2v.save(file_name_model)

    return w2v


def test_model():
    w2v = load_gensim()
    while True:
        user_input = input('Введите слово (или exit):')
        if user_input == 'exit':
            break
        for w, prob in w2v.most_similar(positive=[user_input]):
            print ('%s\t-\t%s' % (w, prob))


morph = pymorphy2.MorphAnalyzer()


def splitter(text):
    exp = re.compile(r',|\.|!|:|\?|-| |\(|\)|<|>|"|&|\n|\t', re.IGNORECASE)
    return [normalizer(word) for word in re.split(exp, text) if len(word) > 2]


def normalizer(word):
    return morph.parse(word)[0].normal_form


def load_hotel():
    reviews = []
    X_p = []
    with open('hotel.txt', 'r') as f:
        reviews = f.read().split('\n')
    reviews = [splitter(t) for t in reviews]

    X_pure = []
    for i in range(len(reviews)):
        x = []
        for j in range(len(reviews[i])):
            vocab = {}
            vocab['word'] = reviews[i][j]
            if j == 0:
                vocab['from'] = 0
            else:
                vocab['from'] = 10
            X_pure.append(vocab)
            x.append(vocab)
        X_p.append(x)
    return X_pure, reviews, X_p


if __name__ == '__main__':
    test_model()







